import React from 'react';
const Cartitems = ({product}) => {
    return (  
          <div className="container">
                <div class="row">
           <table class="table table-striped table-dark conatiner mt-5">

           <thead>
    <tr>
      <th ><img style={{height:'70px'}}className="" src={product.image} alt=""/></th>
      <th scope="col">{product.name}</th>
      <th scope="col">&#8377;{product.price}</th>
      <th scope="col">count chooser</th>
      <th scope="col"><i className="fa fa-trash"></i></th>
    </tr>
  </thead>  
           </table>
           </div>
           </div>
       
    );
}
 
export default Cartitems;
